import React from 'react';
import './Menu.css';

const title = <h1>JUATABOT</h1>;
const contact_email = <p class="contact" >tan.hen@husky.neu.edu</p>;
const contact_instagram = <p class="contact">instagram.com/juatabot</p>


function Menu() {
  return (
    <div class="menuColumn">
      {title}
      {Contact()}
    </div>
  )
}

function Contact() {
  return (
    <div class="contact">
      {contact_email}
      {contact_instagram}
    </div>
  )
}

export default Menu;
